import string
input = ""


def reacts(current, new):
    if current != new and current.lower() == new.lower():
        return True
    else:
        return False


def onePass(input, stack):
    for char in input:
        if not reacts(char, stack[-1]):
            stack.append(char)
        else:
            stack.pop()
    return stack


def main(input):
    # p1
    stack = onePass(input, [""])
    print(len(stack)-1)
    # p2
    best = 0
    for letter in string.ascii_lowercase:
        processed = input.replace(letter, "").replace(letter.upper(), "")
        stack = onePass(processed, [""])
        if len(stack)-1 < best or best == 0:
            best = len(stack)-1
            print(len(stack)-1, "letter: ", letter)


main(input)
